по мере возможности пишите грамотно.без ФфФ и забора.раздражает.

извращенцы и сексуально озабоченные с хуями на аве и вопросами "детка,как насчет куниллингуса?"-удаляйтесь сразу

я не пафосная,хуле.просто у меня критические дни.

-когда сплю,зажимаю половину одеяла между ног;
