-чай пью только черный,слабый с лимоном и с пятью ложками сахара.а то и с шестью;
-иногда бывает,что мама прячет от меня лимон,чтоб я на ночь не пила чай.но я все равно пью,со сливками.отвратительно,конечно.но хотя бы об этом мама не знает;
-для чая я всегда беру бабушкину чашку,потому что она очень большая и в нее помещается куда больше чая,чем в мою;
-засыпаю только под звук телевизора;
-часто сижу,засунув левую руку в штаны;
-ненавижу читать на компьютере.книга в руках гораздо приятнее;
-ненавижу холод.я теплолюбивая;
-ненавижу,когда мерзнут пальцы ног и рук.и нос;
-когда слушаю музыку в общественном транспорте,подергиваю в такт ногой и пою,чем вызываю недоумение у прохожих;
-когда мне нечего делать,сажусь за рояль или синтезатор и играю "The Scientist",или импровизирую;
-сгрызаю лак на ногтях.и не потому что он вкусный,а потому что сильно переживаю за героев мультиков,которые я смотрю;
-меня ужасно бесит расчесывать волосы перед тем,как сушить феном;
-часто приношу еду в комнату и складирую тарелки и чашки из под чая на рабочем столе;а папа потом,возмущается,потому что не может поиграть в свою высокоинтеллектуальную игрушку,ибо на его ноутбуке ее нет;
-по квартире хочу в уличной обуви;и мама лишает меня кофе;хотя какая ей разница?все равно же не ей убирать.и даже не мне;
-кстати,я и кофе пью.но только настоящий и только с пятью ложками сахара.с шестью оно превращается в сироп.чтоб предотвратить ваш дальнейший вопрос,отвечу:нет,чай не превращается в сироп от шести ложек сахара.и даже от семи не превращается.чай вообще сложно испортить;
-люблю рисовать карандашом наброски;мой стиль рисования нельзя назвать адекватным.его вообще вряд ли можно назвать стилем рисования;
-у меня ахуенный потолок;
-я часто ругаюсь с мамой.потому что она истеричка и я истеричка.
-и часто пью успокоительные таблетки.
-я люблю своего Боба.бескорыстно.
-моя абсолютная слабость-это шоколад,молочный.Милка,чаще всего,но могу есть и другие.черный ем,только если он капельку сладкий;
-а еще аниме;
-люблю огромную дохуищу друзей.очень сильно;
-любви,как таковой,у меня не было и не будет.я не собираюсь влюбляться.это самое бесполезное и глупое чувство,которое люди только могли придумать;
-одиночество-удел сильных.слабые жмутся к толпе.следовательно,я слабая.обидно-то как;
-не курю.хотя стоило бы.сигареты меня убьют до того,как у меня начнется климакс;
-а родители курят.и мне это не нравится.но они меня все равно не слушают.идиоты;
-раньше я пила,а потом перестала.мне надоело жевать жвачки,от них нарушается микрофлора кишечника;
-у меня сильные мышцы на правой руке и пресс от рождения.никогда его не качала;
-с людьми,которые мне нравятся,я разговариваю высокомерно.не путайте высокомерие с раздраженностью;
